["skills"].map((x) => x)),    company: json["company"],    deadline: json["deadline"],  );  Map<String, dynamic> toJson() => {    "image": image,    "url": url,    "title": title,    "address": address,    "skills": List<dynamic>.from(skills!.map((x) => x)),    "company": company,    "deadline": deadline,  };}